function InfoTooltip({imgLink, txt, size, isOpen, onClose}) {
  console.log('Прием');
  return (
    // <div className={`popup ${isOpen ? "popup_opened" : ""}`}>
    <div className={`popup popup_opened`}>
      <div className={`popup__container popup__container_size_${size}`}>
        <button className="popup__close-button opacity" onClick={onClose}></button>
        <img src={imgLink} className="popup__tooltip-img"></img>
        <p className="popup__tooltip-txt">{txt}Вы успешно зарегистрировались!</p>
      </div>
    </div>
  )
}

export default InfoTooltip;
